import React, {Component} from 'react';

class AdresCud extends Component {
    render() {
        if(this.props.typ === "add")
        return (
            <tr>
                <td></td>
                <td><Form.Control as="input" name="idDok" defaultValue={this.props.id}  readOnly  /></td>
                <td><Form.Control as="input" placeholder="Enter towar" name="idTow" /></td>
                <td><Form.Control as="input" placeholder="Enter Numer Serijny" name="serTow"/></td>
                <td><Form.Control as="input" placeholder="Enter Ilosc" name="ilTow"/></td>
                <td><Button variant="outline-info" type="submit" className="adrescud"> Dodaj </Button></td>
            </tr>
        );
        else if(this.props.typ === "update")
            return (
                <div>
                    Hello AdresCud update
                </div>
            );
        else if(this.props.typ === "delete")
            return (
                <div>
                    Hello AdresCud delete
                </div>
            );
    }
}

export default AdresCud;
